import React from 'react';
import Head from 'next/head';

export default () => (
  <div>
    <Head>
      <title>My styled page</title>
      <link href="/statics/styles.css" rel="stylesheet" />
    </Head>
    <p className="example">
      Hello world!
    </p>
  </div>
)
